import React, {Component} from 'react';
import {FiPhone} from 'react-icons/fi';
import {FaHome} from 'react-icons/fa';
// import { Rating } from 'semantic-ui-react';
import RatingStar from './RatingStar';
import { Rating } from '@material-ui/lab';



class BusinessList extends Component{

    render(){
        // const RatingExampleStar = () => (
        //     <Rating icon='star' defaultRating={3} maxRating={4} />
        //   );

        const businesses = this.props.businesses;
        const displayBusiness = businesses.map(item => {
            return (
                <div  className="row item-list" key={item.businessID}>
                    <div className="col-sm-5">
                        <img src={item.businessImage} className="image rounded float-center"  alt="..." />

                    </div>
                    <div className="col-sm-7">

                        <h3>{item.businessName}</h3>
                        <p>Rating: {item.businessRating}({item.businessReviewCount})</p>
                        <p><FiPhone />  {item.businessPhone}</p>
                        <p><FaHome /> {item.businessAddress}</p>

                        {/* <RatingStar /> */}
                        {/* {RatingExampleStar} */}
                        {/* <div className="ui star rating" role="radiogroup" tabindex="-1">
                        <i tabindex="0" aria-checked="false" aria-posinset="1" aria-setsize="4" className="active icon" role="radio"></i>
                        <i tabindex="0" aria-checked="false" aria-posinset="2" aria-setsize="4" className="active icon" role="radio"></i>
                        <i tabindex="0" aria-checked="true" aria-posinset="3" aria-setsize="4" className="active icon" role="radio"></i>
                        <i tabindex="0" aria-checked="false" aria-posinset="4" aria-setsize="4" className="icon" role="radio"></i>
                    </div> */}
                    </div>

                </div>
            )
        })

        return(
            <div className="row justify-content-center">
                {/* <div><RatingStar /></div> */}

                <p><Rating name="half-rating" defaultValue={2.3} precision={0.1}  readOnly/></p>
                {displayBusiness}


            </div>
        );
    }
}

export default BusinessList;
